import React from "react";
import GlobalStyleAmin from "../../GlobalStyleAmin";
import { TopBar, SidebarAdmins } from "../../Imports/Index";
const ManagerAmin = () => {
  return (
    <>
      <GlobalStyleAmin />
      <TopBar />
      <div className="container">
        <SidebarAdmins />
      </div>
    </>
  );
};

export default ManagerAmin;
